    stories: {
      background: "/images/backgrounds/stories.jpg",
      title: "Travel Chronicles",
      subtitle: "Immerse yourself in detailed narratives from my journeys around the globe.",
      articles: [
        { 
          title: "Living with Nomads in Mongolia",
          image: "/images/stories/mongolia.jpg",
          alt: "Mongolian nomad family",
          category: "Cultural Immersion",
          excerpt: "Three weeks on the steppes taught me about resilience, hospitality, and life beyond modern conveniences...",
          fullStory: "Three weeks on the steppes of Mongolia changed my perspective on what truly matters in life. Living with nomadic families, I learned to adapt to a lifestyle that has remained largely unchanged for centuries. Each morning began with milking the horses and preparing traditional dairy products. Days were spent helping with herding, cooking, and maintaining the gers (traditional yurts). In the evenings, stories were shared around the fire, passed down through generations.\n\nWithout electricity, running water, or modern communication, I discovered a profound connection to nature and the immediate community. The Mongolian nomads taught me that happiness doesn't come from possessions but from strong family bonds, harmony with nature, and living with purpose. Their incredible hospitality—offering the best of what little they had—humbled me deeply.\n\nAs I traveled with a family to their winter camp, moving their entire household across the vast landscape, I witnessed remarkable resilience and adaptability. These qualities have stayed with me, influencing how I approach challenges in my own life."
        },
        { 
          title: "Hidden Gems of Portugal's Coast",
          image: "/images/stories/portugal.jpg",
          alt: "Portuguese coastal village",
          category: "Hidden Gems",
          excerpt: "Discovering secluded beaches and charming villages beyond the tourist trail revealed the authentic Algarve...",
          fullStory: "Portugal's Algarve coast is famous for its stunning beaches and resort towns, but venture beyond the well-trodden path and you'll discover the region's true charm. I spent three weeks exploring the lesser-known corners of this coastal paradise, staying in small villages where tourism hasn't yet changed the rhythm of local life.\n\nIn Cacela Velha, a tiny whitewashed village perched on a cliff, I found what might be the Algarve's most beautiful beach. Accessible only at low tide by wading across a lagoon, this stretch of golden sand was often completely empty despite its breathtaking beauty. The village itself, with just a handful of houses, a church, and one small restaurant serving the day's catch, offered the authentic Portugal I was seeking.\n\nFurther west, I discovered Benagil beyond its famous sea cave. By staying in the actual village rather than nearby Carvoeiro, I found morning solitude at spots that would be crowded by mid-day. Local fishermen recommended hidden coves accessible only by small boats or challenging footpaths, leading to private swimming spots amid spectacular rock formations.\n\nIn Salema, a fishing village that has maintained its character despite some tourism, I joined locals for the early morning fish auction and learned to prepare cataplana, the traditional seafood stew, from a family who had been fishing these waters for generations.\n\nThe real Algarve, I discovered, is found in the quiet moments: watching fishermen repair nets as the sun rises, joining locals for an espresso at a village café, or hiking ancient paths along dramatic cliffs where the only sounds are waves and birdsong."
        },
        { 
          title: "Learning to Surf at 35",
          image: "/images/stories/surfing.jpg",
          alt: "Surfing in Bali",
          category: "Adventure",
          excerpt: "From complete beginner to riding waves in Bali, this journey taught me it's never too late to challenge yourself...",
          fullStory: "I always thought surfing was something you had to start as a teenager—a sport where the learning curve was too steep to begin in your thirties. But during a month-long stay in Bali, I decided to challenge that assumption. On my first day, struggling just to carry the longboard to the beach, I wondered if I'd made a terrible mistake.\n\nThe initial lessons were humbling. While teenagers and twenty-somethings popped up on their boards with apparent ease, I spent hours just trying to paddle out past the break without being thrown back to shore. My body ached in places I didn't know could ache. But my instructor Made, a patient Balinese surfer who'd been riding waves since childhood, assured me that persistence would pay off.\n\nHe was right. On my seventh day, I caught my first real wave, managing to stand up for a brief, exhilarating moment before tumbling into the white water. That feeling—the brief sense of flying as the wave propelled me forward—was addictive enough to keep me coming back despite the failures.\n\nBy week three, something clicked. My body began to understand the rhythm of the ocean, anticipating rather than reacting to the waves. I started catching more waves than I missed, staying up long enough to actually maneuver the board a little.\n\nOn my final week, I graduated from the beginner's beach to an intermediate spot called Batu Bolong. There, surrounded by surfers of all ages (though still one of the oldest beginners), I caught the wave that made all the bruises and saltwater sinuses worthwhile—a long, smooth ride where time seemed to slow down, where I wasn't thinking about technique but simply experiencing the pure joy of being carried by the ocean's energy.\n\nLearning to surf at 35 reminded me that the artificial limitations we place on ourselves are often just that—artificial. Now back home, far from tropical waters, I still find myself checking surf forecasts and planning my next ocean adventure."
        }
